// Elementos del DOM
const tablaBody = document.querySelector("#tabla-resultados tbody");
const filtroProducto = document.getElementById("filtro-producto");
const filtroEstado = document.getElementById("filtro-estado");
const botonPrev = document.getElementById("prev-pagina");
const botonNext = document.getElementById("next-pagina");
const paginaActualSpan = document.getElementById("pagina-actual");

// Datos desde localStorage
const resultados = JSON.parse(localStorage.getItem("resultados")) || [];
let inspecciones = JSON.parse(localStorage.getItem("resultados")) || [];

// Paginación
let paginaActual = 1;
const resultadosPorPagina = 5;

// Renderiza la tabla con filtros y paginación
function renderizarTabla() {
  const productoFiltro = filtroProducto.value.toLowerCase();
  const estadoFiltro = filtroEstado.value;

  const filtrados = inspecciones.filter(({ producto, estado }) => {
    const coincideProducto = producto.toLowerCase().includes(productoFiltro);
    const coincideEstado = estadoFiltro ? estado === estadoFiltro : true;
    return coincideProducto && coincideEstado;
  });

  const inicio = (paginaActual - 1) * resultadosPorPagina;
  const fin = inicio + resultadosPorPagina;
  const pagina = filtrados.slice(inicio, fin);

  tablaBody.innerHTML = "";

  pagina.forEach((inspeccion, index) => {
    const fila = document.createElement("tr");
    fila.innerHTML = `
      <td>${inspeccion.producto}</td>
      <td>${inspeccion.fecha}</td>
      <td>${inspeccion.observaciones}</td>
      <td>${inspeccion.estado}</td>
      <td><button onclick="generarPDF(${inicio + index})">📄 Exportar PDF</button></td>
    `;
    tablaBody.appendChild(fila);
  });

  paginaActualSpan.textContent = `Página ${paginaActual}`;
  botonPrev.disabled = paginaActual === 1;
  botonNext.disabled = fin >= filtrados.length;
}

// Genera PDF de una inspección
function generarPDF(indice) {
  console.log("Generando PDF para índice:", indice);
  const inspeccion = inspecciones[indice];
  const { jsPDF } = window.jspdf;
  const pdf = new jsPDF();

  const base64Logo = "data:image/png;base64,"; // ← pega aquí tu string completo

  pdf.addImage(base64Logo, "PNG", 10, 10, 40, 20);

  pdf.setFontSize(16);
  pdf.text("REPORTE DE INSPECCIÓN", 70, 20);

  pdf.setFontSize(12);
  pdf.text(`Producto: ${inspeccion.producto}`, 10, 40);
  pdf.text(`Fecha: ${inspeccion.fecha}`, 10, 48);
  pdf.text(`Inspector: ${inspeccion.inspector || "—"}`, 10, 56);
  pdf.text(`Estado: ${inspeccion.estado}`, 10, 64);

  pdf.text("Observaciones:", 10, 74);
  const obs = Array.isArray(inspeccion.observacionesDetalladas)
    ? inspeccion.observacionesDetalladas.map(o => `- ${o.item}: ${o.estado}`)
    : [`- ${inspeccion.observaciones}`];

  obs.forEach((linea, i) => {
    pdf.text(linea, 12, 82 + i * 8);
  });

  const yOffset = 82 + obs.length * 8 + 10;
  pdf.text("Comentarios finales:", 10, yOffset);
  pdf.text(inspeccion.comentarios || "Sin comentarios", 12, yOffset + 8);

  pdf.setFontSize(10);
  pdf.text("Este reporte fue generado automáticamente por INSPECTIA-WEB", 10, 280);

  pdf.save(`reporte-${inspeccion.producto}.pdf`);
}

// Eventos de interacción
filtroProducto.addEventListener("input", () => {
  paginaActual = 1;
  renderizarTabla();
});

filtroEstado.addEventListener("change", () => {
  paginaActual = 1;
  renderizarTabla();
});

botonPrev.addEventListener("click", () => {
  if (paginaActual > 1) {
    paginaActual--;
    renderizarTabla();
  }
});

botonNext.addEventListener("click", () => {
  paginaActual++;
  renderizarTabla();
});

// Inicializa la tabla
renderizarTabla();